import React, { Component } from "react";

import "./Node.css";

export default class Node extends Component {
  constructor(props) {
    super(props);
    this.state = {
      col: Number,
      row: Number,
      g: Number.MAX_VALUE,
      h: Number.MAX_VALUE,
      visited: false,
      obstacle: false,
      neighbors: [],
      parent: null,
    };
  }

  render() {
    const { isStartNode, isEndNode } = this.props;
    const getNodeClass = isStartNode
      ? "node-start"
      : isEndNode
      ? "node-end"
      : "";

    return <div className={`node ${getNodeClass}`}></div>;
  }
}
